graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "legacyProcessor" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>legacyProcessor</b> <i>&lt;task&gt;</i> <i>@Deprecated("Use newProcessor instead") @Version("1.0")</i></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style="filled,dashed", color="#1976D2", fontcolor="#999999"];
  "newProcessor" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>newProcessor</b> <i>&lt;task&gt;</i> <i>@Version("2.0")</i></td></tr></table>>, shape=box, fillcolor="#E3F2FD", style=filled, color="#1976D2"];

  // Edges
  "legacyProcessor" -> "newProcessor" [labelOverlay="75%", labelhref="#srcLineTBD"];
}
